import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the search input field using its ID
    const searchInput = page.locator('#searchInput');
    const searchTerm = 'iPhone';

    // Type into the search field to trigger autocomplete
    await searchInput.fill(searchTerm);

    // Wait for the suggestions container to become visible
    const suggestionsContainer = page.locator('.search-suggestions');
    await suggestionsContainer.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot showing the autocomplete suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions_visible.png'));

    // Select the first suggestion item
    const firstSuggestion = suggestionsContainer.locator('.suggestion-item').first();
    const suggestionText = await firstSuggestion.innerText();

    // Click the first suggestion
    await firstSuggestion.click();

    // Wait for the suggestions container to be hidden after selection
    await suggestionsContainer.waitFor({ state: 'hidden', timeout: 5000 });

    // Verify that the search input's value has been updated
    const finalInputValue = await searchInput.inputValue();
    if (finalInputValue !== suggestionText) {
      throw new Error(`Search input value was not updated correctly. Expected "${suggestionText}", but got "${finalInputValue}".`);
    }

    // Take a final screenshot to show the result
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestion_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestion_selected.png'));

    return {
      success: true,
      action: "Successfully typed in the search bar, waited for autocomplete, and selected a suggestion.",
      extractedData: {
        initialSearchTerm: searchTerm,
        clickedSuggestion: suggestionText,
        finalInputValue: finalInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
